package com.arjun.leetcode;

public class Solution11111 {
    public boolean isSubsequence(String s, String t) {
        String newStr = "";
        for (int i = 0; i < t.length(); i++) {
            char c = t.charAt(i);
            if (s.contains(c + "")) newStr += c + "";
        }
        System.out.println(newStr);
        return s.equals(newStr);
    }

    public static void main(String[] args) {
        Solution11111 s = new Solution11111();
        System.out.println(s.isSubsequence("leeeeetcode",
                ""));
    }
}
